  render() {

    return (
      <div>
        <div>

        </div>
        <div>
          <Navigation style={{display: 'inline'}}>
              <Link to="/project"><img className="ProjectPic" src={BetsFriends}/></Link>
          </Navigation>
        </div>
      </div>
    );
  }
  }
export default LandingPage;
